import React from 'react';
import { useState, useEffect } from 'react';
import axios from 'axios'
import { Marker } from 'google-maps-react'

const Markers = () => {

        let [locations, setLocations] = useState([])
      
        useEffect (() => {
          axios.get('https://maps.googleapis.com/maps/api/place/textsearch/json?query=miami&type=restaurant&key=AIzaSyBibnOWEr72nhfg0dEPgv5Amv09pXcRk_M')
          .then((response) => {

            console.log(response.data)
            setLocations(response.data);
        })
      }, []);


    return (
        locations.map(location => {
            return (
                <Marker title={'location'}
                name={'SOMA'} position={{lat: 25.762672391722948, lng: -80.223313421781}}></Marker>)
        })
    )
}

export default Markers;
